import Header from './Header';

const Layout = props => {
  return (
    <>
      <Header />
      <div className="container">{props.children}</div>

      <style jsx>{`
        * {
          padding: 0;
          margin: 0;
          font-family: Tahoma;
          box-sizing: border-box;
        }

        .container {
          width: 80%;
          margin: 0 auto;
        }
      `}</style>
    </>
  );
};

export default Layout;
